import React, { Component } from 'react'
import QrReader from 'react-qr-reader'
import extractEmails from './emailAddress'
import GetMobileNumber from './MobileNumber'
import getUrl from './url'
class App extends Component {
  state = {
    result: ''
  }

  handleScan = data => {
    if (data) {
      this.setState({
        result: data
      })
    }
  }
  handleError = err => {
    console.error(err)
  }

  render() {
    return (

      <div className=" row  text-white bg-dark">
        <div className="col-6">
        <QrReader
          delay={100}
          onError={this.handleError}
          onScan={this.handleScan}
          style={{ width: '100%' }}

        />
         </div>
         {!this.state.result ? <p>Welcome to Qr code Info Extractor</p> :
         <div className="col-6">
           <p> Qr Code Conatins :  {this.state.result}</p>
           <br></br>
           <br></br>
        <p>Phone Number is {GetMobileNumber(this.state.result)}</p>
        <p>Email is {extractEmails(this.state.result)}</p>
        <p>Url is {getUrl(this.state.result)}</p>
      </div>}
      </div>

    )
  }
}
export default App;
